import { Button, Card } from "@mantine/core";
import React from "react";
import Home from "./home1";
import './Page.css';
import { useState } from "react";





function Cart()
{
    return(

        <div>
        <Button className="Cart_Button" onClick={()=>{console.log("Hello")}}>Bought</Button>
        <Button className="Cart_Button">Pending</Button>
        <Card className="Cart_card" withBorder>
            <Button>Hello World</Button>        
        </Card>
        </div>
    )
}

export default Cart
